import React from "react";
import Frame1945 from "../Frame1945";
import Frame3509 from "../Frame3509";
import Frame3500 from "../Frame3500";
import Layer2 from "../Layer2";
import "./Component13.css";

function Component13(props) {
  const { text109, frame1945Props, frame3509Props, frame3500Props, layer2Props, className } = props;

  return (
    <div className={`component-18 ${className || ""}`}>
      <Frame1945
        group={frame1945Props.group}
        vector={frame1945Props.vector}
        vector2={frame1945Props.vector2}
        vector3={frame1945Props.vector3}
        vector4={frame1945Props.vector4}
        vector5={frame1945Props.vector5}
        text28={frame1945Props.text28}
      />
      <Frame3509 frame3593Props={frame3509Props.frame3593Props} className="frame-35092" />
      <Frame3500 text37={frame3500Props.text37} cart2Props={frame3500Props.cart2Props} />
      <div className="frame-35032">
        <div className="frame-35943">
          <Layer2 personProps={layer2Props.personProps} />
          <div className="text-109 ibmplexsans-semi-bold-shark-16px">{text109}</div>
        </div>
      </div>
      <div className="rectangle-8594"></div>
    </div>
  );
}

export default Component13;
